import React from 'react';
import ReactDOM from 'react-dom';
import Card from './Card';
import Array_obj from './Array';
import './index.css';




ReactDOM.render(
<React.Fragment>

<h1 className="heading_style">List of top five Netflix Series </h1>


  return( 
    <Card 
          imgsrc={val.imgsrc}
          title={val.title}
          link={val.link}
          name={val.name}/>)
  }
}
</React.Fragment>,
document.getElementById("root")
